
// globals  
var active_layers = []; // keep
var cameraMarkers = [];
var cameraInfoWindows = [];
var arrMarkers = [];
var arrInfoWindows = [];

// initialize the map (called from dom_ready.js)
// set center, zoom level and type 
function initialize() {
    var myOptions = {
        center: new google.maps.LatLng(39.99791,-75.15398),
        zoom: 10,
        mapTypeId: google.maps.MapTypeId.ROADMAP
    };

    // set the <div> as the map's canvas
    var map = new google.maps.Map(document.getElementById("map_canvas"),
        myOptions);

    return map;
}

//-------------------- google traffic ---------------------------
// add google traffic to the map
function add_traffic(options, map){
    active_layers[options['name']] = new google.maps.TrafficLayer();
    active_layers[options['name']].setMap(map);
}

// remove google traffic to the map
function remove_traffic(options, map){
    active_layers[options['name']].setMap(null);
}


//--------------------- kml files --------------------------------
//  add a kml layer from a data feed
function addLayer(options, map) {
    active_layers[options['name']] = new google.maps.KmlLayer(options['feed']);
    active_layers[options['name']].setMap(map);
}

// remove kml layer from a data feed
function removeLayer(options, map) {
    active_layers[options['name']].setMap(null);
}


//--------------------- penndot cameras -----------------------------


function add_penndot(map) {
$.getJSON("penndot.json", {}, function(data){

    $.each(data.object_name, function(i, item){
	$("#markers").append('<li><a href="#" rel="' + i + '">' + item.name + '</a></li>');
	var marker = new google.maps.Marker({
	    position: new google.maps.LatLng(item.lat, item.lng),
	    map: map,
	    title: item.title
	});

	arrMarkers[i] = marker;

	var infowindow = new google.maps.InfoWindow({
	    content: "<h3>"+ item.name +"</h3><p><img src=\""+ item.url +"\"></p>"
	});

	arrInfoWindows[i] = infowindow;
	google.maps.event.addListener(marker, 'click', function() {
//	    $('#map_canvas').gmap('closeInfoWindow');

	    infowindow.open(map, marker);
	});
    });
});
}



// remove penndot
function remove_penndot(map) {
    var i;
    var len;
    for (i = 0, len = arrMarkers.length; i < len; i += 1) {
        arrMarkers[i].setMap(null);
    }
}















